#include "gtest/gtest.h"
#include "../../src/中级算法/LengthOfLongestSubstring.h"

TEST(test2, case1) {
    char s[] = "abcabcbb";
    EXPECT_EQ(lengthOfLongestSubstring(s), 3);
}

TEST(test2, case2) {
    char s[] = "bbbbb";
    EXPECT_EQ(lengthOfLongestSubstring(s), 1);
}

TEST(test2, case3) {
    char s[] = "pwwkew";
    EXPECT_EQ(lengthOfLongestSubstring(s), 3);
}

TEST(test2, case4) {
    char s[] = " ";
    EXPECT_EQ(lengthOfLongestSubstring(s), 1);
}

TEST(test2, case5) {
    char s[] = "abcdefg";
    EXPECT_EQ(lengthOfLongestSubstring(s), 7);
}

